// import logo from './logo.svg';
import './App.css';
import Header from './components/Header';
import Post from './components/Post';
import Posts from './data/posts.js';

function App(props) {
  return (
    <div className="margin paper">
      <Header name={props.config.name} />

      {Posts.map((post, i) => 
        <Post key={i} post={post}/>
      )}

      <div className="border border-3 margin-small padding-small">
        <article className="article">
          <h2 className="article-title text-center">Join Shopee ID as Backend Engineer</h2>
          <p className="text-lead text-center"> <a href="https://shopee.co.id/">Shopee</a> - Feb 2020</p>

          <div className="sm-12 md-12 text-center">
            <p>
              Shopee ID Tech Team
            </p>
            <img src="images/shopee_3_interns_last_day.jpg" alt="Shopee Tech Team" className="row flex-center article-image--half-size border-4" />
          </div>

          <hr/>
        </article>
      </div>
    </div>
  );
}

export default App;
